import React, { Component } from 'react';
import './main.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Link} from 'react-router-dom';
import { Redirect } from 'react-router';
import { MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText, MDBCol } from 'mdbreact';


class Sidebar extends Component {
    constructor(props){
        super(props);
        this.state = {
        }
    }

    render(){
        return (
            <div id="slide-out" classNameName="side-nav sn-bg-4 fixed" style={{transform: 'translateX(0%)'}}>
                <ul classNameName="custom-scrollbar">
                    <li>
                        <div classNameName="logo-wrapper waves-light waves-effect waves-light">
                            <a href="#"><img src="https://mdbootstrap.com/img/logo/mdb-transparent.png" classNameName="img-fluid flex-center"/></a>
                        </div>
                    </li>
                </ul>
                <div className="sidenav-bg mask-strong">
                </div>
            </div>
        );
    }
}
export default Sidebar;
